import React from "react";
import { Text, Stack } from "@chakra-ui/core";
import Card from "../molecules/card";
import Link from "next/link";

const Settings = () => {
  return (
    <Card
      gridArea="1 / 1 / 2 / 2"
      heading="Project details"
      pageLink="/settings"
    >
      <Stack isInline>
        <Text>Placholder</Text>
        <Link href="/">
          <Text>Placholder</Text>
        </Link>
      </Stack>
    </Card>
  );
};

export default Settings;
